export const returnDeviceSearch = (search, infoType, string) => {
  let container = []
  search.forEach(profile => {
    profile.forEach(e => {
      if (e.data.toString().toLowerCase().includes(string)) {
        infoType.push(e.type);
        container.push(profile);
      }
    });
  });
  return [...new Set(container)];
}
